import React from 'react';
import './LandingPage.css';


const LandingPage = () => {
  return (
    <div className="landing-wrapper">
      <nav className="navbar">
        <div className="nav-logo">CourseSphere</div>
        <div className="nav-links">
          <a href="/" className="active">Home</a>
          <a href="/login">login</a>
          <a href="/register">register</a>
          <a href="#contact">Contact</a>
        </div>
      </nav>

      <div className="landing-main">
        <div className="landing-left">
          <h1><span>MANAGE</span><br />BETTER</h1>
          <p>Lorem ipsum dolor sit amet, consectetur<br />eiusmod tempor incididunt ut labore et.</p>
          <div className="landing-buttons">
          <a href="/login"><button className="btn-outline">GET STARTED</button></a>
          </div>
        </div>
        <div className="landing-right">
          <img src="/books-illustration.png" alt="" />
        </div>
      </div>
    </div>
  );
};

export default LandingPage;
